grids:
  wgs84:
    srs: 'EPSG:4326'
    bbox: [-180, -90, 180, 90]
    bbox_srs: 'EPSG:4326'
    # res: [0.15873908440210452, 0.07936954220105226, 0.03968477110052613, 0.02539825350433673, 0.012699126752168366, 0.006349563376084183, 0.0031747816880420914, 0.0015873908440210457, 0.0007936954220105229, 0.00031747816880420905, 0.00015873908440210453, 0.00007936954220105226, 0.000031747816880420904, 0.000015873908440210452, 0.000007936954220105226, 0.000003174781688042091, 0.0000015873908440210455]
    res_factor: 'sqrt2'
    tile_size: [512, 512]
  sphericalmercator:
    base: GLOBAL_MERCATOR
    num_levels: 18

globals:
  # cache options
  cache:
    base_dir: '/opt/mapproxy/tilecache'
    lock_dir: '/opt/mapproxy/tilecache/tilelocks'
    meta_size: [2, 2]
    meta_buffer: 0
    concurrent_tile_creators: 16

  # image/transformation options
  image:
      resampling_method: bilinear
      jpeg_quality: 90
      # stretch cached images by this factor before using the next level
      stretch_factor: 1.1
      # shrink cached images up to this factor before returning an empty image (for the first level)
      max_shrink_factor: 4.0

  http:
    ssl_no_cert_checks: true

